import React from "react";
import "./login.css";
export default function Login() {
  return (
    <div className="login">
      <div className="loginWrapper">
        <div className="loginLeft">
          <h3 className="loginLogo">App Name</h3>
          <span className="loginDesc">Social media app created with react</span>
        </div>
        <div className="loginRight"></div>
      </div>
    </div>
  );
}
